import React, {Component} from 'react';
import axios from 'axios';

class FetchInfo extends Component {
    constructor(){
        this.areaSrc = 'https://hotelinfoservice.sunwingtravelgroup.com/en/AllHotelDestinationList';
        this.areas;
    }
    componentDidMount(){
        axios.get(this.areaSrc)
            .then(res=>{
                this.areas = res;
                console.log(this.areas);
            });
    }
}

export default FetchInfo;
